import React, { useState, useEffect } from 'react';
import '../App.css';

function Salary() {
  const [incomes, setIncomes] = useState([]);
  const [newIncome, setNewIncome] = useState({ source: '', amount: '', date: '' });
  const [total, setTotal] = useState(0);

  useEffect(() => {
    // Load incomes from local storage on initial load
    const storedIncomes = JSON.parse(localStorage.getItem('incomes')) || [];
    setIncomes(storedIncomes);
    calculateTotal(storedIncomes);
  }, []);

  useEffect(() => {
    // Save incomes to local storage whenever they change
    localStorage.setItem('incomes', JSON.stringify(incomes));
    calculateTotal(incomes);
  }, [incomes]);

  const calculateTotal = (incomeList) => {
    const sum = incomeList.reduce((acc, inc) => acc + parseFloat(inc.amount || 0), 0);
    setTotal(sum.toFixed(2));
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewIncome({ ...newIncome, [name]: value });
  };

  const handleAddIncome = () => {
    if (newIncome.source && newIncome.amount && newIncome.date) {
      setIncomes([...incomes, { ...newIncome, id: Date.now() }]);
      setNewIncome({ source: '', amount: '', date: '' });
    }
  };

  const handleDeleteIncome = (id) => {
    setIncomes(incomes.filter(inc => inc.id !== id));
  };

  return (
    <div className="salary-container">
      <h2>Income Tracker</h2>
      <div className="add-income">
        <input
          type="text"
          name="source"
          value={newIncome.source}
          onChange={handleInputChange}
          placeholder="Income Source"
        />
        <input
          type="number"
          name="amount"
          value={newIncome.amount}
          onChange={handleInputChange}
          placeholder="Amount ($)"
          step="0.01"
        />
        <input
          type="date"
          name="date"
          value={newIncome.date}
          onChange={handleInputChange}
        />
        <button onClick={handleAddIncome}>Add Income</button>
      </div>
      <div className="incomes-list">
        {incomes.length > 0 ? (
          <table>
            <thead>
              <tr>
                <th>Date</th>
                <th>Source</th>
                <th>Amount ($)</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody>
              {incomes.map(inc => (
                <tr key={inc.id}>
                  <td>{inc.date}</td>
                  <td>{inc.source}</td>
                  <td>{inc.amount}</td>
                  <td>
                    <button className="delete-btn" onClick={() => handleDeleteIncome(inc.id)}>Delete</button>
                  </td>
                </tr>
              ))}
            </tbody>
            <tfoot>
              <tr>
                <td colSpan="2"><strong>Total</strong></td>
                <td><strong>${total}</strong></td>
                <td></td>
              </tr>
            </tfoot>
          </table>
        ) : (
          <p>No income recorded yet.</p>
        )}
      </div>
    </div>
  );
}

export default Salary;
